import React , {Component} from 'react';
import {Media,Card,CardImg,CardImgOverlay,CardText,CardBody,CardTit} from 'reactstrap';

class Menu extends Component{

	constructor(props){
		super(props);
	}

	render(){
		const menu=this.props.dishes.map((dish)=>{//it is a for loop
			return (
				<div key={dish.id} className="col-12 col-md-5 mt-5">
					<Card>
						<Media left middle>
							<Media object src={dish.image} alt={dish.name}/>
						</Media>	
						<Media body className="ml-5">
							<Media heading>{dish.name}</Media>
							<p>{dish.description}</p>
						</Media>
					</Card> 
				</div>
				);
		});

		return(
			<div className="container">
				<div className="row">
					<Media list>
					{menu}
					</Media>
				</div>
			</div>
			);
	}
}

export default Menu;
